description:
Katniss Everdeen has returned home safe after winning the 74th Annual Hunger Games along with fellow tribute Peeta Mellark. Winning means that they must turn around and leave their family and close friends, embarking on a &quot;Victor's Tour&quot; of the districts. Along the way Katniss senses that a rebellion is simmering, but the Capitol is still very much in control as President Snow prepares the 75th Annual Hunger Games (The Quarter Quell) - a competition that could change Panem forever.

Jennifer Lawrence as Katniss Everdeen  
Josh Hutcherson as Peeta Mellark  
Sam Claflin as Finnick Odair  
Elizabeth Banks as Effie Trinket  
Alan Ritchson as Gloss  
Jena Malone as Johanna Mason  
Stanley Tucci as Caeser Flickerman  
Willow Shields as Primrose Everdeen  
Woody Harrelson as Haymitch Abernathy  
Philip Seymour Hoffman as Plutarch Heavensbee  
Donald Sutherland as President Snow  
Amanda Plummer as Wiress  
Meta Golding as Enobaria  
Lenny Kravitz as Cinna  
Lynn Cohen as Mags  
Toby Jones as Claudius Templesmith  
Stephanie Leigh Schlund as Cashmere  
Bruno Gunn as Brutus  
Maria Howell as Seeder  
E. Roger Mitchell as Chaff  
Patrick St. Esprit as Romulus Thread  
Liam Hemsworth as Gale Hawthorne

